import React from "react";
import { Link } from "react-router-dom";

import * as ROUTES from "../../constants/routes";

export default function index() {
  return (
    <div>
      <ul>
        <li>
          <Link to={ROUTES.SIGN_IN}>Sign IN</Link>
        </li>
      </ul>
    </div>
  );
}
